import React from "react";
import "./style.css";
import LinkedIn from '@material-ui/icons/LinkedIn';
import GitHub from '@material-ui/icons/GitHub';
import Email from '@material-ui/icons/Email';
import { Tooltip } from '@material-ui/core';
import Row from "../Row";
import Col from "../Col";


function Footer() {
  return (
    <footer className="footer">
      <center><span>R.A. Portfolio 2020</span></center>



          <center>
            <Tooltip title="search"><a className="Iconbuttons" href={"/search"}><LinkedIn
                      style={{ fontSize: 45, minWidth:'120px', color:'#DEB841'}} 
                      label="Search" 
                      /></a></Tooltip>

            <LinkedIn 
            style={{
              color: '#DEB841',
              fontSize: '60px',
              marginRight:'20px',
              marginTop:'5px'}}/>,
            <GitHub
            style={{
              color: '#DEB841',
              fontSize: '45px',
              marginRight:'20px',
              marginTop:'5px'}}/>
            <Email
            style={{
              color: '#DEB841',
              fontSize: '45px',
              marginRight:'20px',
              marginTop:'5px'}}/>
          </center>

    </footer>
  );
}
export default Footer;
